import React from "react";
import "./SignUp.css"
const SignUp = () => {
    return (
        <div className="main">
            <div className="mainInside">
                <button className="wallet">Connect To MetaMask Wallet</button>
            </div>
        </div>
    )
}
export default SignUp;
